Sometimes specifications express a fact which is true about a function, but the verifier cannot prove it automatically, or it uses features not yet supported by Prusti. In such cases, it is possible to mark a function as #[trusted]: extern crate prusti_contracts;
use prusti_contracts::*; #[trusted]
#[ensures(*a == old(*b) && *b == old(*a))]
fn xor_swap(a: &mut i32, b: &mut i32) { *a ^= *b; *b ^= *a; *a ^= *b;
} In the above example, the contract for xor_swap is correct, but Prusti would not be able to verify it because it uses currently unsupported XOR operations. While a common application of #[trusted] is to wrap functions from the standard library or external libraries, notice that external specifications provide a more robust solution for this use case.

